import React from "react";
import "../App.css";
import Login from "./Login";
import LeftNav from "./LeftNav";
import RightNav from "./RightNav";

function Main() {
  return (
    <div>
      <div className="main">
        <img src="https://media.giphy.com/media/Q6joirtIBHUsw/giphy.gif"></img>
        </div>

      <Login />
      <LeftNav />
      <RightNav />
    </div>
  );
}

export default Main;
